import './App.css';
import { ExpensesItem } from './components/ExpensesItem';

function App() {
  const expenses = [
    {title: 'Köp Toalet papper', amount: '10', pris: '100kr'},
    {title: 'Köp Mjölk', amount: '2', pris: '30kr'},
    {title: 'Köp Pankaka', amount: '1', pris: '60kr'},
    {title: 'Köp Cykel', amount: '1', pris: '500kr'},
  ]
  return (
    <div className="App">
      <header className="App-header">
        <ExpensesItem title={expenses[0].title} amount={expenses[0].amount} pris={expenses[0].pris} />
        <ExpensesItem title={expenses[1].title} amount={expenses[1].amount} pris={expenses[1].pris} />
        <ExpensesItem title={expenses[2].title} amount={expenses[2].amount} pris={expenses[2].pris} />
        <ExpensesItem title={expenses[3].title} amount={expenses[3].amount} pris={expenses[3].pris} />
      </header>
    </div>
  );
}

export default App;
